import { StyleSheet, TextInput, View, SafeAreaView, Pressable } from 'react-native'
import React from 'react'

const AddUser = () => {
  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.viewContainer}>
        <form>
          <TextInput style={styles.textInput} id="inputName" editable maxLength={40} placeholder="Nombre" />
          <TextInput style={styles.textInput} id="inputLastName" editable maxLength={40} placeholder="Apellido" />
          <TextInput style={styles.textInput} id="inputCI" editable maxLength={8} placeholder="C.I" />
          <TextInput style={styles.textInput} id="inputMatAuto" editable maxLength={7} placeholder="MAT. Auto" />
          
        </form>
      </View>
    </SafeAreaView>
  )
}

export default AddUser

const styles = StyleSheet.create({
  container: {

  },
  viewContainer: {
    padding: 30
  },
  textInput: {
    borderColor: "#142492",
    borderWidth: 4,
    borderRadius: 5,
    width: 300,
    padding: 7,
    color: "#142492",
    marginLeft: 'auto',
    marginRight: 'auto',
    marginBottom: 30
  },
  submitButton: {
    marginLeft: 'auto',
    marginRight: 'auto',
    color: 'red',
    
  }
})
